    RA_Action GetAction(int row, RA_Symbol column) noexcept
    {
        assert(row >= 0 && row <= 72);
        assert(column >= RA_Symbol::comma && column <= RA_Symbol::_Z);
        return action_table[row][(int) column];
    }

    RA_Production GetProduction(int i) noexcept
    {
        return productions[i];
    }
